import React from 'react';
import { Link } from 'react-router-dom';
import Iframe from 'react-iframe';

const ProductionPage = (props) => {
  return (
    <div>
      <h1>FRESH BEATS FOR SALE</h1>
      <p>
        <Link to='/'>Home</Link>

        <Iframe 
          url='https://player.beatstars.com/?storeId=122207'
          width='100%'
          height='800'
          id=''
          className=''
          display='initial'
          position='relative'
          sandbox=''
        />

      </p>
      <button onClick={() => props.history.push('/')}>Home</button>
      <button onClick={() => props.history.push('/mastering-song-list')}>Production Song List</button>
  </div>
  );
}


export default React.memo(ProductionPage);
